			#,CONCAT(US_REC.NombreUsuario, ' ', US_REC.ApellidoPaternoUsuario, ' ', US_REC.ApellidoMaternoUsuario) AS 'NombreUsuarioRecibe', 
			,US_REC.NombreUsuario as NombreUsuarioRecibe 
